    const {searchInput, filteredResults, filteredData} = props
    const {searchMovies, setSearchMovies} = useContext;


  return (
    <div>
        {
            filteredData.map((item) => {
                return(
                    <SearchedComponent {...item} key={item.id}/>
                )
            })
        }   
    </div>
  )
}

export default Searched
